import React from 'react';
import { Dimmer, Icon, Image, Loader } from 'semantic-ui-react';

export default function NavBar() {
	return (
		<div class='ui segment'>
			<Dimmer active>
				<Loader>Loading</Loader>
			</Dimmer>
			<Icon loading name="spinner" />
		</div>
	);
}
